import React, { useState } from 'react';
import HeaderComponente from '../../componetes/header/headerComponente';

function App() {
  const [formSelecionado, setFormSelecionado] = useState(null);

  const handleSelecionarFormulario = (formId) => {
    setFormSelecionado(formId);
  };

  const tiposAcomodacoes = () => (
    <>
        <form className="acomodacoes">
        <h2>Tipos de Acomodações</h2>
        <h4>Adicionar tipo de Acomodação</h4>
        Código <input type="text" placeholder="Produto" />  
        Quantidade de Total <input type="number" placeholder="Quantidade" /> <br></br>
        Descrição <textarea placeholder="Descreva o tipo de acomodação" rows={4} cols={50} style={{ resize: 'vertical', padding: '8px' }}/>        <input type="text" placeholder="Fornecedor" />
        <input type="text" placeholder="Observações" />
        </form>
        <button type='submit' className='cad_quartos'>Adicionar acomodação</button>
    </>
  );

  const acomodacoes = () => (
    <>

<form className="tiposacomodacoes">
        <h2>Acomodações</h2>
        <div>
            Número da acomodação: <input type="text" placeholder="Ex: 101" /><br></br>
            Andar: <input type="number" placeholder="Ex: 101" /><br></br>
            Tipos de acomodações: <select>
                <option>Apartamento de luxo</option>
                <option>Apartamento de luxo especial</option>
                <option>Suíte especial</option>
                <option>Suíte master</option>
            </select><br></br>

            Unidade do Hotel <select>
                <option>Gramado</option>
                <option>Canoas</option>
                <option>Santa Maria</option>
                <option>Pelotas</option>
            </select><br></br>
        </div>
        </form>
        <button type='submit' className='cad_acomodacoes'>Adicionar acomodação</button>
    </>
  );

  return (
    <>
        <main>
            <HeaderComponente></HeaderComponente>
            <div style={{ padding: '20px' }}>
            <h1>Sistema de acomodações</h1> <br></br>
            <h4>Gerenciamento dos tipos de acomodações</h4>
            <input type="button" value="Tipos de acomodações" onClick={() => handleSelecionarFormulario(1)} />
            <input type="button" value="Quartos" onClick={() => handleSelecionarFormulario(2)} />

            <div style={{ marginTop: '20px' }}>
                {formSelecionado === 1 && tiposAcomodacoes()}
                {formSelecionado === 2 && acomodacoes()}
            </div>
            </div>
            
        </main>
    </>
  );
}

export default App;
